  const [loadedProp, setLoadedProp] = useState([]);

  useEffect(() => {
    setIsLoading(true);
  fetch("http://localhost:3002/properties/5d2b113b43cbfd7c77a99993")
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      setIsLoading(false)
      setLoadedProp(data)
      console.log(loadedProp)
    });

  }, []);

  
